import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import styles from './CreateHorarios.module.css'; // Importe o CSS atualizado
const CriarHorarioPage = () => {
  const [diasTrabalho, setDiasTrabalho] = useState([]);
  const [horaInicio, setHoraInicio] = useState('');
  const [horaFim, setHoraFim] = useState('');
  const [horaInicioAlmoco, setHoraInicioAlmoco] = useState('');
  const [horaFimAlmoco, setHoraFimAlmoco] = useState('');
  const [barbeiroId, setBarbeiroId] = useState(1); // Substitua pelo ID real do barbeiro logado
  const [selectedDia, setSelectedDia] = useState(null);
  const navigate = useNavigate();

  const intervalos = Array.from({ length: 24 * 2 }, (_, i) => {
    const hora = Math.floor(i / 2).toString().padStart(2, '0');
    const minuto = (i % 2) * 30 === 0 ? '00' : '30';
    return `${hora}:${minuto}`;
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('/home/novo-horario', {
        barbeiroId,
        diasTrabalho,
        horaInicio,
        horaFim,
        horaInicioAlmoco,
        horaFimAlmoco,
      });
      navigate('/home');
    } catch (error) {
      console.error('Erro ao criar horário', error);
    }
  };

  const handleSelectDia = (dia) => {
    if (diasTrabalho.includes(dia)) {
      setDiasTrabalho(diasTrabalho.filter(diaTrabalho => diaTrabalho !== dia));
    } else {
      setDiasTrabalho([...diasTrabalho, dia]);
    }
  };

  return (
    <div className={styles.container}>
      <h1>Criar Novo Horário</h1>
      <form onSubmit={handleSubmit}>
        <label>
          Dias de Trabalho:
          <div className={styles.box}>
            <ul className={styles.list}>
              {['Segunda', 'Terça', 'Quarta', 'Quinta', 'Sexta', 'Sábado', 'Domingo'].map(dia => (
                <li
                  key={dia}
                  onClick={() => handleSelectDia(dia)}
                  className={`${styles.boxList} ${styles.diaBoxList} ${diasTrabalho.includes(dia) ? styles.selected : styles.unselected}`}
                >
                  {dia}
                </li>
              ))}
            </ul>
          </div>
        </label>

        <label>
          Hora Início:
          <div className={styles.box}>
            <ul className={styles.list}>
              {intervalos.map(hora => (
                <li
                  key={hora}
                  onClick={() => setHoraInicio(hora)}
                  className={`${styles.boxList} ${styles.horaBoxList} ${horaInicio === hora ? styles.selected : styles.unselected}`}
                >
                  {hora}
                </li>
              ))}
            </ul>
          </div>
        </label>

        <label>
          Hora Fim:
          <div className={styles.box}>
            <ul className={styles.list}>
              {intervalos.map(hora => (
                <li
                  key={hora}
                  onClick={() => setHoraFim(hora)}
                  className={`${styles.boxList} ${styles.horaBoxList} ${horaFim === hora ? styles.selected : styles.unselected}`}
                >
                  {hora}
                </li>
              ))}
            </ul>
          </div>
        </label>

        <label>
          Hora Início Almoço:
          <div className={styles.box}>
            <ul className={styles.list}>
              {intervalos.map(hora => (
                <li
                  key={hora}
                  onClick={() => setHoraInicioAlmoco(hora)}
                  className={`${styles.boxList} ${styles.horaBoxList} ${horaInicioAlmoco === hora ? styles.selected : styles.unselected}`}
                >
                  {hora}
                </li>
              ))}
            </ul>
          </div>
        </label>

        <label>
          Hora Fim Almoço:
          <div className={styles.box}>
            <ul className={styles.list}>
              {intervalos.map(hora => (
                <li
                  key={hora}
                  onClick={() => setHoraFimAlmoco(hora)}
                  className={`${styles.boxList} ${styles.horaBoxList} ${horaFimAlmoco === hora ? styles.selected : styles.unselected}`}
                >
                  {hora}
                </li>
              ))}
            </ul>
          </div>
        </label>

        <button type="submit">Salvar</button>
      </form>
    </div>
  );
};

export default CriarHorarioPage;
